create database ela;
Use ela;

CREATE TABLE School (
SchoolID 	INT NOT NULL auto_increment,
School_Name 	VARCHAR(80),
Address 	VARCHAR(80),
CONSTRAINT School_SchoolID_pk PRIMARY KEY (SchoolID));

CREATE TABLE UserAccount (
UserID 		INT NOT NULL auto_increment,
SchoolID 	int(5),
FName 		VARCHAR(20) NOT NULL,
LName 		VARCHAR(20) NOT NULL,
Email 		VARCHAR(50) NOT NULL,
Password 	VARCHAR(60) NOT NULL,
AccountType 	VARCHAR(20),
RecoveryPassword	Boolean,
CONSTRAINT UserAccount_UserID_pk PRIMARY KEY (UserID),
CONSTRAINT UserAccount_SchoolID_fk FOREIGN KEY (SchoolID) REFERENCES School  (SchoolID));

CREATE TABLE Teacher (
TeacherID 	INT NOT NULL auto_increment,
SchoolID 	int(5),
UserID 		int(5) NOT NULL,
CONSTRAINT Teacher_TeacherID_pk PRIMARY KEY (TeacherID),
CONSTRAINT Teacher_SchoolID_fk FOREIGN KEY (SchoolID) REFERENCES UserAccount (SchoolID),
CONSTRAINT Teacher_UserID_fk FOREIGN KEY (UserID) REFERENCES School (SchoolID));

CREATE TABLE Class (
ClassID		INT NOT NULL auto_increment,
TeacherID	int(5),
Grade		int(2),
ClassYear	int(4),
Size		int(2),
CONSTRAINT Class_ClassID_pk PRIMARY KEY (ClassID),
CONSTRAINT Class_TeacherID_fk FOREIGN KEY (TeacherID) REFERENCES Teacher(TeacherID));

CREATE TABLE ClassHistory (
ClassHistoryID INT NOT NULL auto_increment,
ClassID	int(5),
ClassYear 	int(4),
StudentID INT (5),
CONSTRAINT ClassHistory_ClassHistoryID_pk PRIMARY KEY (ClassHistoryID),
CONSTRAINT ClassHistory_ClassID_fk FOREIGN KEY (ClassID) REFERENCES Class(ClassID),
CONSTRAINT ClassHistory_ClassYear_fk FOREIGN KEY (ClassYear) REFERENCES Class(ClassYear),
CONSTRAINT ClassHistory_StudentID_fk FOREIGN KEY (StudentID) REFERENCES Student(StudentID));

CREATE TABLE Assessment (
ExamID	INT NOT NULL auto_increment,
BookID int(5),
ClassHistoryID	int(5),
Date	DATE NOT NULL,
ClassSize	int(2),
CONSTRAINT Assessment_ExamID_pk PRIMARY KEY (ExamID),
CONSTRAINT Assessment_ClassHistoryID_fk FOREIGN KEY (ClassHistoryID) REFERENCES ClassHistory(ClassHistoryID),
CONSTRAINT Assessment_BookID_fk FOREIGN KEY (BookID) REFERENCES Book(BookID),
CONSTRAINT Assessment_ClassSize_fk FOREIGN KEY (ClassSize) REFERENCES Class(Size));

CREATE TABLE Book (
BookID INT NOT NULL auto_increment,
Name VARCHAR(50),
NumberOfQuestions INT(3),
BookNumber INT(2),
Grade INT(2),
Year DATE,
CONSTRAINT Book_BookID_pk PRIMARY KEY (BookID));

CREATE TABLE Student (
StudentID INT NOT NULL auto_increment,
FName Varchar (50) NOT NULL,
LName varchar (50) NOT NULL,
CONSTRAINT Student_StudentID_PK PRIMARY KEY(StudentID));

CREATE TABLE StudentAnswers (
AnswerID INT NOT NULL AUTO_INCREMENT,
ExamID INT (5) NOT NULL,
QuestionID INT (5) NOT NULL,
QuestionNumber INT (3) NOT NULL,
LetterAnswer VARCHAR (1) NOT NULL,
CONSTRAINT StudentAnswers_AnswerID_PK PRIMARY KEY (AnswerID),
CONSTRAINT Exam_ExamID_FK FOREIGN KEY (ExamID) REFERENCES Assessment(ExamID),
CONSTRAINT Question_QuestionID_FK FOREIGN KEY (QuestionID) REFERENCES Question(QuestionID));

CREATE TABLE Story (
StoryID INT NOT NULL AUTO_INCREMENT,
Title VARCHAR(90),
Author VARCHAR(40),
CONSTRAINT Story_StoryID_PK PRIMARY KEY (StoryID));

CREATE TABLE Question (
QuestionID INT NOT NULL auto_increment,
StoryID INT(5),
CorrectAnswer VARCHAR(1) NOT NULL,
QuestionType VARCHAR(1) NOT NULL,
Points INT(1) NOT NULL,
Std INT(1) NOT NULL,
QuestionText VARCHAR(255) NOT NULL,
Indicator VARCHAR(100) NOT NULL,
Evidence VARCHAR (400),
KeyWords VARCHAR (150),
QuestionNumber INT NOT NULL,
CONSTRAINT Question_QuestionID_PK PRIMARY KEY (QuestionID),
CONSTRAINT Question_Indicator FOREIGN KEY (Indicator) REFERENCES Categories(Indicator),
CONSTRAINT Story_StoryID_FK FOREIGN KEY (StoryID) REFERENCES Story(StoryID));

CREATE TABLE Categories (
Category int(1) NOT NULL,
Indicator VARCHAR(100) NOT NULL,
primary key (Category,Indicator));

CREATE TABLE Choices (
ChoiceID INT NOT NULL auto_increment,
QuestionID INT(5),
Letter VARCHAR(1) NOT NULL,
Text VARCHAR(100) NOT NULL,
CONSTRAINT Choices_ChoiceID_PK PRIMARY KEY (ChoiceID),
CONSTRAINT Questions_QuestionID_FK FOREIGN KEY (QuestionID) REFERENCES Question(QuestionID));

CREATE TABLE WordFrequency (
WordFreqID INT NOT NULL auto_increment,
StoryID INT (5) NOT NULL,
Word varchar (45) NOT NULL,
Frequency INT(4) NOT NULL,
CONSTRAINT WordFrequency_WordFreqID_PK PRIMARY KEY (WordFreqID),
CONSTRAINT Story_StoryID_FK FOREIGN KEY (StoryID) REFERENCES Story(StoryID));

























































































































































































































































































































































































































































































































































































































